(464, 46, 79, 1, 'Energy', '這是一首很白痴的歌\r\n歌詞沒什麼內容\r\n純粹是一個思春少年\r\n在一個很悶的晚上\r\n亂想出來的\r\n送給世上所有的冰山美人!!', '2007-04-06 00:00:00', 0000, 10, 0, 5, 'Give me your soul and don''t be shy\r\nGet on the road I won''t be lie\r\nCuz I''m the man who take you\r\nTo the place of love it''s only in my mind\r\n\r\nTouch me babe and don''t ask why\r\nOpen your mind and hold me tide\r\nIt''s the way I love you\r\nTill the end of world and never say goodbye\r\n\r\nMy mama told me to be quite\r\nMy baba told me to stay light\r\nI won''t hear them cuz I''m the man\r\nGonna take you on my bed\r\nGonna take you on my bed!!', '', 207, '', '江江江', '江江江', '江江江', '', '', 1, 1, 0, '2008-02-27 11:26:45', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(465, 46, 79, 2, 'No Way Out', '', '2007-04-06 00:00:00', 0000, 10, 0, 7, 'I am coming out \r\nwith anger in my mind\r\ncuz of what you said\r\nWhy don''t you think of me\r\nI''m always in your side\r\ncan not bear anymore\r\n\r\n(chorus)\r\nI hate that what you said\r\nI mean that you should paid\r\nEscapin'' from that way\r\nBut No one could understand\r\n(I need the way out)\r\n\r\nI want to come down\r\nBut lots of words in my mind\r\nmake me feel no way out\r\nIf I try to say\r\nFuck you all turkeys\r\nYou guys make me crazy \r\n', '', 196, '', '江江江', '江江江', '江江江 &amp; BFWSP', '', '', 1, 1, 0, '2008-02-27 11:28:25', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(466, 46, 79, 3, 'Oh Yeah', '寫出我們對於大自然的熱愛', '2007-04-06 00:00:00', 0000, 10, 0, 7, 'I see you singing in the brilliant sky\r\nI hear you now, to call me back \r\nI see you standing on the world so wide\r\nCan’t I help myself? I’m in your mind\r\n\r\nI wish you always on my side alright\r\nYou hold me now, inspire my mind \r\nScenery under your knees so high \r\nDon’t be shied, you in my sight\r\n\r\nThey all crazy because of you, yeah~~\r\nNo one can get free from your deep blue eyes\r\nHow I want to be with you? yeah~~\r\nI give you my soul, I give you~~\r\n\r\nOh Ya~~ coming inside\r\nOh Ya~~ Into my mind\r\nOh Ya~~ coming inside\r\nOh Ya~~ Into my mind\r\n', '', 220, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:30:11', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(467, 46, 79, 4, 'Hopeless', '常有一種感覺\r\n懷疑自己當下是活在夢中還是現實中?\r\n而感到無比的虛無飄渺這種無助感...\r\nHopeless用愛情的觀點描述夢與現實邊界的模糊不清', '2007-04-06 00:00:00', 0000, 10, 0, 7, 'I TAKE IT IN MY EYE THAT I TAKING I\r\nTAKE IT TO THE SIDE THAT WE GOES BY\r\nI GOT TO ASK YOU WHY CAUSE I MESSED UP\r\nWHY YOU ALWAYS TELL A LIE THAT I FUCK UP\r\n\r\nYOU GOT TO MAKE IT FALLING\r\nYOU HAVE TO TELL ME ONCE\r\nI GOT TO TOUCH THE LETTER\r\nI HAVE TO TAKE IT ALL\r\nPLEASE HELP ME THAT OUT~~~~\r\n\r\nSELFISH HONEY~~ HOW DO YOU FEEL....\r\nI CAN’T STOP MYSELF~~ WHY CAN''T YOU TELL.\r\nSELFISH HONEY~~ HOW DO YOU FEEL....\r\nI CAN’T STOP MYSELF~~ IS IT REAL?\r\n\r\nI HAD DREAMED A PLACE THAT I WAS NEVER BEEN\r\nTHAT IS A IMAGE THATI WAS EVER LOST IT....\r\nYOU TAKE ME OUT THE WAY THAT I DROP''N IN\r\nTO A PLACE THAT MOONLIGHT COULDN''T SHINE IN\r\n\r\nIF ALL..IF FALL..\r\nI COULD..I COULD.', '', 285, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:32:36', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
