(469, 46, 79, 6, 'Hey Hey', '', '2007-04-06 00:00:00', 0000, 10, 0, 7, 'I Don''t want to see\r\nSee the surface of things\r\nI Don''t want to know\r\nknow the something in your mind that I never know\r\n\r\nI Don''t want to hear\r\nhear your affectation\r\nI really want to know\r\nknow the darkside in your mind that never gone\r\n\r\n\r\nThere is nothing to fear\r\nyou have to move on\r\nThere is nothing to lose \r\nyou have to wake up\r\nThere is nothing to care\r\nyou have to cut off\r\nThe pure soul in our minds \r\nyou have to keep on, come, come, come...', '', 311, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:38:10', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(470, 46, 79, 7, 'New Hope', '當心愛的人離自己而去時....\r\n雖然每天想著她和另一個人溫存的畫面\r\n有如刀割般的痛苦\r\n那一絲絲的希望~~\r\n不願意相信自己的命運!!\r\n希望有一天她能回來', '2007-04-06 00:00:00', 0000, 0, 1, 5, 'Baby I could even touch your heart now\r\nI wish I could be the man of hope\r\nAt first Time I realize one thing\r\nThe reason you''ll come to my life\r\nTired body eat away my deepest will\r\nIt could never be my destiny\r\nI hope you understand what I''ve done is to pretend\r\nIt could never be my destiny\r\n\r\nBaby I still think of you every night\r\nHow could you hurt me like this\r\nImagining you both on the fucking bed\r\nIt seems like a needle into my skin\r\nThis pain press myself and I can not really breathe\r\nOh my Lord please don''t increase my hate\r\nI hope you understand what I''ve done is to pretend\r\nOh my Lord please don''t increase my hate', '', 239, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:40:17', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(471, 46, 79, 8, 'Energy (Live)', '', '2007-04-06 00:00:00', 0000, 0, 1, 5, '', '', 200, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:42:00', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(472, 46, 79, 9, 'The Answers', '明明喜歡著她. 卻只能跟她說自己不可能跟她在一起. 等她真的不可能愛自己的時候. 獨自無力後悔. 這種矛盾. 在多年後回想. 其實很有趣', '2007-04-06 00:00:00', 0000, 0, 1, 4, 'In this moment I do see\r\n驀然間又遇到妳\r\nStart the passion we used to share\r\n\r\nThis is how I wanna be\r\n擦肩而過的感情\r\nSuddenly I can find the answer\r\n\r\nHold me sugar\r\nHold me sugar\r\nHold me sugar\r\nCome into my mind\r\nHold me sugar\r\nHold me sugar\r\nHold me sugar\r\nI wish you never cry\r\n(我已不再依賴)\r\n\r\n今夜的我依然下著雨\r\n還是看不到妳蹤影\r\n心窩的情水何時退去\r\n\r\n望著背影看著妳遠行\r\n讓我感覺好無力\r\n悶在心裡的種種話語', '', 209, '', '', '', '', '', '', 1, 1, 0, '2008-02-27 11:43:47', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(473, 65, 90, 1, '男孩的玩具', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '記不記得   男孩的玩具\r\n坦克大砲士兵和步槍\r\n你是否能夠想像  這個男孩長大的模樣\r\n\r\n記不記得  所謂的歷史課\r\n帝王和戰爭  戰爭和帝王\r\n你是否能夠想像  這個男孩長大的模樣\r\n\r\n後來男孩成為了我\r\n我果然也感到迷惑\r\n那首推翻帝王的詩\r\n此刻我還沒有讀過\r\n只覺得一切不太清楚\r\n只覺得有些決定  正在決定著我\r\n\r\n習不習慣  我習慣的表達\r\n自大的男人固執又多話\r\n你大概可以想像  那個男孩抓著坦克在廝殺', 274, '', '', '', '', '', '', 0, 1, 0, '2008-02-27 14:56:51', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(474, 65, 90, 2, '科學怪人的玫瑰', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '套上防水的長靴  壓低了帽緣\r\n走向某個深夜  走向黑暗雨中\r\n上帝的世界  我想我並不理解 這該如何\r\n達爾文的世界  我想我也不理解 而她在輕聲的說\r\n\r\n誰需要自由\r\n那裡面沒有安全感  和用力擁抱 和被依賴\r\n當你經過我的時候\r\n我就驕傲的展示著  只管驕傲的展示著\r\n\r\n有一片遼闊的海  從來沒機會見過\r\n鏽蝕的螺絲釘  支持了旅行的夢\r\n仍然想要感覺  仍然想說些什麼 (but no one really care)\r\n仍然想接納信仰  仍然不需要理解  而她輕聲的說', 347, '', '', '', '', '', '', 0, 1, 0, '2008-02-27 15:09:35', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(475, 65, 90, 3, '撒野俱樂部', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '踢開了路上石塊 把雙手放在口袋\r\n隨時隨地的遊行 哼著大調歌曲\r\n嘴巴嚷嚷著憤怒身體誠實地跳舞\r\n隨時隨地的遊行 爭取些無所事事\r\n\r\n無所事事的時間 無所事事的權力 what ever we trust\r\n\r\nin Clubbing we trust in Groove we trust\r\nin Google we trust whatever we trust\r\n有天成為了被對抗的大人 也別忘記今晚\r\n我們帶群孩子闖進誰的殿堂 去撒泡尿 去撒撒野\r\n\r\n你怎麼會忘記 那些俱樂部男孩\r\n他們變成相片 傻傻的嵌在這裡\r\n還自以為是最初和最終的偶像\r\n但都不是今晚 也不會是現在', 345, '', '', '', '', '', '', 0, 1, 0, '2008-02-27 15:14:27', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(476, 65, 90, 4, '努特', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '沙漠的香料商人 帶著寶藏進來\r\n城市的領導人們\r\n正在一起建設我們不會居住的綠洲\r\n\r\n* 管你的春天會不會來\r\n最後的冬天也走了\r\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\r\n\r\n已沒那麼性感 厚重的引擎聲\r\n仍灰灰的城市裡\r\n我們一起建設沒有機會居住的綠洲\r\n\r\n** 香料商人牽著我的手\r\n我向努特say hello\r\n他向冬天說了Bye\r\n春天也一起離開', 257, '', '', '', '', '', '', 0, 1, 0, '2008-02-27 15:18:45', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(477, 65, 90, 5, 'Circus In My Head', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '這一場公路電影 看完想高空彈跳\r\n配合著這段吉他 我還要跳火圈\r\n有什麼奇怪想法 不可言喻的趣味\r\n還是可以改變 軟趴趴的世界\r\n\r\n還有一些時間 幹嘛愁眉苦臉\r\n牽手走過大街 捐出用不完的熱血\r\n還有一些時間 不要愁眉苦臉\r\n至少我還有搖滾樂 and circus in my head\r\n\r\n這一場公路電影 看完想高空彈跳\r\n配合著這段吉他 我還要跳火圈\r\n那一些刺激感覺 一定要自己體會\r\n有一些刺激感覺 沒有動物實驗', 211, '', '', '', '', '', '', 0, 1, 0, '2008-02-29 00:29:59', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(478, 65, 90, 6, '80''s (zac Squeamish Remix)', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '', 338, '', '', '', '', '', '', 0, 1, 0, '2008-02-29 16:11:22', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
(479, 65, 90, 7, 'Johnny''s Bear (Raykai Highway No.3 Mix)', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', 'Tonight I feel some pain\r\n玩具熊睜開眼　誇張的驚叫著\r\nTonight I got the sense\r\n不可理喻的諷刺的喜劇裡　我依然雀躍著\r\n\r\n每個叫 Johnny 的男孩\r\n身上總有野薑花香　無聊的　暈黃的\r\n\r\nJohnny 他也許明白　我喜歡安靜被馴養著', 258, '', '', '', '', '', '', 0, 1, 0, '2008-02-29 17:11:23', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
