(481, 65, 90, 9, 'Dear Friend (Dylan & Chouc Mix)', '', '2007-10-05 00:00:00', 0000, 25, 0, 7, '', '每次總在酒醒之前就醒過來　然後從容的離開\r\n那些說過的話　並不像發自內心的說　卻總聽得明白\r\n\r\n好喜歡你的影子　和你的旋律\r\n好喜歡你的影子　我們的自作聰明\r\n好喜歡你的影子　和你的旋律\r\noh my dear friend\r\n\r\noh my dear friend\r\n你美麗的眼睛　享不享受這現在　現在還有沒有期待\r\noh my dear friend\r\n你迷濛的眼睛　我只剩下現在　現在就是我的期待\r\n\r\n這是上帝應許的花　在驕傲的盛放', 448, '', '', '', '', '', '', 0, 1, 0, '2008-02-29 17:27:37', '2015-03-12 13:30:19', '0000-00-00 00:00:00'),
