(602, 561, 121, 6, '搬家', '', '2007-08-14 00:00:00', 0000, 20, 0, 5, '', '三箱的CD 兩箱的玩具 四箱的書 半箱的秘密\n發黃的牆壁 刮花的磨石地 年輪的回憶 怎麼整理\n在士林的五坪裏晾著內衣\n樓下的７-１１是營養補給\n呼吸著不怎麼新鮮的空氣 不知不覺\n門上貼了個喜 We Are Family\n\nAre we moving moving moving moving\nTo a place with free\nAre we moving moving moving moving\nTo a place without lonely\nI wish\n\n凋零的市區 奢侈的郊區 驕傲的鬧區 遊戲的學區\n鋼筋水泥的臺北叢林 生存下來需要一點勇氣\n搬離一個半成品 搬到下一次累積\n兩百公里外的媽咪 依然等著我\n不是不想回去 覺得有點來不及\n\nI am moving moving moving moving\nTo a place with free\nI am moving moving moving moving\nTo a place without lonely\nI wanna go home\nWhich one could be the one\nI am still moving moving moving moving\nTo a place with free\nI am still moving moving moving moving\nTo a place without lonely', 190, '奇哥', '', '', '', '', '', 1, 1, 0, '2008-03-04 17:36:23', '2015-03-12 13:30:23', '0000-00-00 00:00:00'),
